import React, { Component } from 'react';

class Comp2 extends Component {

    constructor(props){
        super(props);
        this.state={}
    }
    increment=()=>{
        this.props.dispatch({type: 'INCREMENT'})
    };

    render() {

        return (
            <div className="">
                <input type='button' value='+' onClick={this.increment}/>
            </div>
        );
    }}

export default Comp2;
